import React from "react";

// reactstrap components
import {
  Button,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container,
  Row,
  Col
} from "reactstrap";

import { List, ListItem, Card, CardActionArea, CardActions, CardContent, CardMedia, Typography } from '@material-ui/core/';
import { makeStyles } from '@material-ui/core/styles';

// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import GenericHeader from "components/Headers/GenericHeader.js";
import DefaultFooter from "components/Footers/DefaultFooter.js";
import Contact from "components/General/Contact.js";
import OurTeam from "components/General/OurTeam.js";
import "react-responsive-carousel/lib/styles/carousel.min.css";

import { Carousel } from 'react-responsive-carousel';



const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
  media: {
    height: 140,
  },
});

function MediaCard() {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image="/static/images/cards/contemplative-reptile.jpg"
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Lizard
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}


function AboutPage() {
  const [firstFocus, setFirstFocus] = React.useState(false);
  const [lastFocus, setLastFocus] = React.useState(false);
  React.useEffect(() => {
    document.body.classList.add("landing-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    return function cleanup() {
      document.body.classList.remove("landing-page");
      document.body.classList.remove("sidebar-collapse");
    };
  });
  const headerImage = "url(" + require("assets/img/bg5.jpg") + ")";

  return (
    <>
      <ExamplesNavbar />
      <div className="wrapper">
        <GenericHeader image={headerImage} title="¿Quiénes Somos?" subtitle="Representantes de Obligacionistas"/>

        <div className="section section-about-us">
          <Container>
            <Row>
              <Col className="ml-auto mr-auto text-center" md="8">
                <h2 className="title">Quiénes somos?</h2>
                <h5 className="description">
                  Gbholders es una firma de abogados basada en un concepto original que busca 
                  diferenciarse positivamente de la competencia, aportando un valor agregado a sus 
                  servicios y otorgando confianza a sus clientes, basándose en la calidad técnica 
                  jurídica, cultura de trabajo, calidad de servicio y adaptación al cambio.
                </h5>
              </Col>
            </Row>
            <div className="separator separator-primary"></div>
          </Container>
        </div>
        <Container>
            <Row>
          <List>
            <ListItem>
              <MediaCard/>
            </ListItem>
            <ListItem>
              <MediaCard/>
            </ListItem>
            <ListItem>
              <MediaCard/>
            </ListItem>
          </List>
          </Row>
          </Container>
          <OurTeam/>
          <Contact/>
        <DefaultFooter />
      </div>
    </>
  );
}

export default AboutPage;
